import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Nav, NavItem, NavLink, Media } from 'reactstrap';
import Image from 'react-bootstrap/Image';
import './Sidebar.css';
import avatar from '*/images/testImages/face.jpeg';


class SideMenu extends Component {
    render() {
        return (
            <div className="sidebar-container">
                <div className="user-details">
                    <span className="username">Username</span>
                    <Media>
                        <Image
                            className="avatar"
                            src={avatar}
                            alt="User Avatar"
                            fluid />
                    </Media>
                </div>

                <Nav vertical className="sidebar-menu">
                    <NavItem>
                        <NavLink tag={Link} to="/create-post">
                            Create Post
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink tag={Link} to="/join-group">
                            Join Group
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink tag={Link} to="/create-group">
                            Create Group
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink tag={Link} to="/log-out">
                            Log Out
                        </NavLink>
                    </NavItem>
                </Nav>
            </div>
        );
    }
}

export default SideMenu;
